import ReactCSSTransition from 'react-addons-css-transition-group';
import './styles.css'
//Material-UI imports
import { Typography } from '@material-ui/core';
//components import
import NavBar from '../NavBar/NavBar';

export default function Home() {
    useEffect(() => {
        console.log('start')
    }, [])

    return (
        <div className="App">
            <NavBar />
            <ReactCSSTransition
                transitionName="fade"
                transitionEnterTimeout={300}
                transitionLeaveTimeout={300}>
                <Typography variant="h2" gutterBottom>Hello world!</Typography>
            </ReactCSSTransition>
        </div>
    );
}
